import React from "react";
import { Card } from "antd";
import Avatar from "antd/lib/avatar/avatar";

const UserProfile = () => {
  return (
    <>
      <Card>
        <Card.Meta avatar={<Avatar>Hi</Avatar>} title="Hyoil"></Card.Meta>
      </Card>
    </>
  );
};

export default UserProfile;
